import { Carousel } from "react-responsive-carousel";
import "./Caroussel.css"

const Caroussel = () => {

    const datas = [
        {
            id: 1,
            image : 'https://vonguru.fr/wp-content/uploads/2022/07/stranger-things-saison-4-cinerserie-cover-vonguru-min.jpg',
            title : 'Stranger Things',
            genre : 'Horror Drame Surnaturel',
            summary : "En 1983, à Hawkins dans l'Indiana, Will Byers disparaît de son domicile. Ses amis se lancent alors dans une recherche semée d'embûches pour le retrouver. Pendant leur quête de réponses, les garçons rencontrent une étrange jeune fille en fuite."
        },
        {
            id : 2,
            image : 'https://vader.news/__export/1591069210952/sites/gadgets/img/2020/06/02/breaking_bad_prtada.png_1121438045.png',
            title : 'Breaking Bad',
            genre : 'Drame Criminel Suspense',
            summary : "Walter White, 50 ans, est professeur de chimie dans un lycée du Nouveau-Mexique. Pour réunir de l'argent afin de subvenir aux besoins de sa famille, Walter met ses connaissances en chimie à profit pour fabriquer et vendre du crystal meth."
        },
        {
            id : 3,
            image : 'https://images.contentstack.io/v3/assets/blt731acb42bb3d1659/blt8739d07baed7d77d/5ed9b1c197379739c07664d9/Arcane_Announcement_Banner.jpg',
            title : 'Arcane',
            genre : 'Fantasy Action Drame',
            summary : "Au milieu du conflit entre les villes jumelles de Piltover et Zaun, deux soeurs se battent dans les camps opposés d'une guerre entre technologies magiques et convictions incompatibles."
        },
        {
            id : 4,
            image : 'https://www.studioghibli.fr/wp-content/uploads/2009/07/spirited_away1-1024x638.png',
            title : 'Le voyage de Chihiro',

        }
    ]
    return (
        <Carousel>
            <div>Slide 1</div>
            <div>Slide 2</div>
            <div>Slide 3</div>
        </Carousel>

    );
};

export default Caroussel;
